import { UserService } from '@/services/user.service';
import { InfoService } from "./info.service";
import MemberCard from '@/views/biz-components/h5/pages/member-card';
import H5Container from '@/views/biz-components/h5/h5-container';
import { MEMBER_CARD } from '@/views/biz-components/h5/pages/member-card.config';
import { SELL_STATUS, SUPPORT_SALES, CONSUMPTION_RANGE } from '@/constants/card/deposit';
import { shop_columns, price_gradient_columns } from "./info.config";
export default {
  bem: {
    item: 'brand-card'
  },
  components: {
    MemberCard: MemberCard,
    H5Container: H5Container
  },
  serviceInject: function serviceInject() {
    return {
      infoService: InfoService,
      userService: UserService
    };
  },
  rxState: function rxState() {
    return {
      shopName: this.userService.shop$,
      cardInfo: this.infoService.cardInfo$ // consumer_types: this.userService.getOptions$('deposit_card.consumer_type')

    };
  },
  data: function data() {
    return {
      SELL_STATUS: SELL_STATUS,
      SUPPORT_SALES: SUPPORT_SALES,
      CONSUMPTION_RANGE: CONSUMPTION_RANGE,
      MEMBER_CARD: MEMBER_CARD,
      shop_columns: shop_columns,
      price_gradient_columns: price_gradient_columns
    };
  },
  computed: {
    canUseShop: function canUseShop() {
      var text = '';

      switch (this.cardInfo.consumption_range.id) {
        case CONSUMPTION_RANGE.ONLY_STORE:
          text = this.cardInfo.consumption_range.name;
          break;

        case CONSUMPTION_RANGE.GENERAL_STORE:
          text = "\u5171".concat(this.cardInfo.can_use_shop_num, "\u5BB6\u95E8\u5E97");
          break;

        case CONSUMPTION_RANGE.ALL_STORE:
          text = '全门店';
          break;

        default:
          text = '无';
      }

      return text;
    }
  },
  mounted: function mounted() {
    // let consumerEnum = this.consumer_types
    this.cardInfo.consumerList = this.cardInfo.consumer_type; //  this.cardInfo.consumer_type.map(
    //   item => consumerEnum.filter(i => i.value === item)[0].label
    // )
  }
};
